import React, { Component } from "react";
import '../../App.css';
import * as videoStyles from  "../../styles/video";
import axios from 'axios';

import { connect } from "react-redux";



class Timer extends Component {

    constructor(props){
        super(props); 
              
    }
    componentDidMount(){
       
    }
    render() {
      

        return (
            <div style = {videoStyles.videoInfo}><h3 style={videoStyles.timer}>16:29:48</h3>
              
            </div>
   

        );
    }
}


const mapStateToProps = state =>{
   
    return {
        link : state.surveillanceReducer.link
     }
}

const mapDispatchStateToProps = dispatch => {
    return {
        surveillance : () => {
            axios.get('http://localhost:3001/live-surveillance').then(response=>{
                dispatch({type: "surveillance",payload : response.data})
            })
                    
            
        }
    }
}

export default (connect(mapStateToProps,mapDispatchStateToProps)(Timer));
